      | 352938 -> { ItemTypeData.id= 352938; name= "Assault Type-II"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  A flat-coil e5000 fifth generation fusion core runs up the inside of the back plate, powering the entire suit. Its output and heat buildup are controlled by a L2 “Gatekeeper” regulator conduit, which connects directly to the sensor system at the base of the neck. Every joint is reinforced with kinetic sensors and two-way, high torque servos to enhance the soldier’s strength, balance, and resistance to impact forces. The suit’s helmet has more integrated sensor, communication, targeting, and data processing systems than most civilian vehicles. As is common with Caldari designs, armor plating is limited to vital areas, relying instead on high-power shield systems to protect the wearer.   Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 353132 -> { ItemTypeData.id= 353132; name= "'Bedlam' M512-A Submachine Gun"; published= false; description= "Favoring function over form, the SMG is a lightweight, semi-automatic weapon designed for close-quarters combat. What it lacks in stopping power and accuracy it grossly overcompensates for with quantity. Designed to injure and impede, the hailstorm of bullets the SMG produces is most effective in tight spaces against multiple targets.  This original design is a paradigm of Minmatar construction. An inelegant, but reliable weapon solution that is simple to produce, easily repaired using almost any available materials, and provides comparable pound-for-pound performance with similar sub-automatic weapons. Although an unabashedly low-tech weapon, it excels at what it was designed for: killing anything right in front of you."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 353229 -> { ItemTypeData.id= 353229; name= "Flux Repair Tool"; published= false; description= "By projecting a focused harmonic beam into damaged materials, the repair tool channels construction nanites to return the targeted matter to its original state. Its on-board processor interfaces with a forward-facing sensor suite, instantly recognizing vehicles, devices, and personal armor based on microscopic manufacturer's tags. The beam, a bi-channel “hollow laser”, simultaneously acts as both a containment field and transport medium for the nanite swarm, which works to sift unwanted particles from the structure, undo ionization, and reconstruct the atomic patterns of the material.  The repair tool has several design innovations, the most surprising probably being the incorporation of Amarr focusing crystal technology. Beyond that, the device also makes use of an advanced K7 nano static co-processor on par with Caldari planet side missile tracking systems and a 55x5 reverse current power cell configuration rarely used beyond self-sustaining Gallente drone units. The result is an elegant tool combining the best technology from several very different design philosophies."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
