      | 366712 -> { ItemTypeData.id= 366712; name= "Commando G/1-Series"; published= false; description= "The Commando dropsuit is a variable combat unit capable of reacting to battlefield threats as they emerge. Built using a repurposed heavy frame, the suit is designed for maximum offensive flexibility. The streamlined frame does away with extraneous armor layers, using the augmented power of the exoskeleton to instead shoulder the weight and bulk of two light-class weapons.    Modified to better interface with light-class blaster weaponry, the Gallente Commando’s subframe regulates the weapon’s cyclotron output, improving plasma compression and enhancing the magnetic acceleration of the produced discharge with devastating results.    The Commando is the ultimate suppression fighter. What the suit sacrifices in tactical versatility, it more than makes up for with flexible weapon loadouts that can counter any of the myriad threats an ever-evolving battlefield may present."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
